import React from 'react';

const Input = ({ val, onChange }) => {
    return (
        <input
            type='text'
            style={{ width: '300px', borderRadius: '5px', height: '40px', textAlign }}
            onChange={e => onChange(e.target.value)}
            value={val} 
            placeholder='Add Todo Here'
            />
    )
}

export default Input;
